window.bookSummaryJSON = "<p>For a moment, I thought I had everything, only to have my happiness snatched away from me by more betrayals and lies.</p> <p>Ares, Rafe, Killian, and Nox abandoned me four years ago, and now their final secret has come out: They've been working with the institute who hurt my friends and tried to sell me to the highest bidder; a deranged alpha who tried to leave me bred and broken.</p> <p>This time, the pack's gone too far. I'm done hearing their excuses. I'm done handing out second chances. I might be an omega, but I'm done putting myself last.</p> <p>If they want my forgiveness, they're going to have to beg for it.</p> <p>Contains mature themes.</p>"; 
